import {
  StyleSheet,
  View,
  Text,
  Button,
  Image,
  ImageBackground,
  TouchableOpacity,
  Modal,
  TouchableHighlight,
  StatusBar,
  SafeAreaView,
  ScrollView,
  Linking,
} from "react-native";
import { globalStyles } from "../styles/global";
import Location from "../screens/locations";
import FitImage from "react-native-fit-image";
import { MaterialIcons } from "@expo/vector-icons";
//import { ScrollView } from 'react-native-gesture-handler';
import Eventsmodal from "../components/eventsmodal";
import { WebView } from 'react-native-webview';


export default class App extends Component {
  render() {

    return (
      <View style={{ flex: 1,}}>
        <SafeAreaView style={globalStyles.darkHeader}><Text style={globalStyles.headerText}>Equippers</Text></SafeAreaView>
        <WebView
        ref={ref => (this.webview = ref)}

        source={{uri:  currentSite}}

        style={{height:550}}

        scrollEnabled={true}
        startInLoadingState={true}

        onNavigationStateChange={this._onNavigationStateChange.bind(this)}
        javaScriptEnabled = {true}
        domStorageEnabled = {true}

        startInLoadingState={false}
        onLoad={() => this.hideSpinner()}

        injectedJavaScript={jsCode}
        onMessage={event => {

        //Html page
        const wishData = event.nativeEvent.data;
         this._getProductName(wishData);
         this._getProductPrice(wishData);

        }}
      /> 
      </View>
    );
  }
}
